(85, '1471927406download (1).jpg', '<div class=\"contentText\">\r\n<div align=\"justify\">Bagian ini berisi informasi mengenai PemerintahanDesa. Sila klik pada tautan berikut untuk mendapatkan informasi yang lebih rinci.</div>\r\n<div align=\"justify\">&nbsp;</div>\r\n<ol>\r\n<li>Visi dan Misi</li>\r\n<li>Pemerintah Desa</li>\r\n<li>Badan Permusyawaratan Desa</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>VISI dan MISI</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>VISI</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>\"Senggigi Berseri\"</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>(Bersih, Relegius, Sejahtera, Rapi, dan Indah)</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>\"Terwujudnya masyarakat Desa Senggigi yang Bersih, Relegius, Sejahtra, Rapi dan Indah melalui Akselerasi Pembangunan yang berbasis Keagamaan, Budaya Hukum dan Berwawasan Lingkungan dengan berorentasi pada peningkatan Kinerja Aparatur dan Pemberdayaan Masyarakat\"</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>MISI</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>Misi dan Program Desa Senggigi</strong></p>\r\n<p style=\"text-align: justify;\">Dan untuk melaksanakan visi Desa Senggigi dilaksanakan misi dan program sebagai berikut:</p>\r\n<p style=\"text-align: justify;\">1. Pembangunan Jangka Panjang</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Melanjutkan Pembangunan Desa yang belum terlaksana</li>\r\n<li style=\"text-align: justify;\">Meningkatkan Kerjasama antara pemerintah Desa dengan Lembaga desa yang ada</li>\r\n<li style=\"text-align: justify;\">Meningkatkan Kesejahtraan Masyarakat desa dengan meningkatkan sarana dan prasarana ekonomi warga.&nbsp;</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">2. Pembangunan Jangka Pendek &nbsp;</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Mengembangkan dan Menjaga serta melestarikan ada istiadat desa terutama yang telah mengakar di desa senggigi.&nbsp;</li>\r\n<li style=\"text-align: justify;\">Meningkatkan pelayanan dalam bidang pemerintahan kepada warga masyarakat&nbsp;</li>\r\n<li style=\"text-align: justify;\">Meningkatkan sarana dan prasarana ekonomi warga desa dengan perbaikan prasarana dan sarana ekonomi.</li>\r\n<li style=\"text-align: justify;\">Meningkatkan sarana dan prasarana pendidikan guna peningkatan sumber daya manusia desa senggigi.&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>Kepala Desa Senggigi</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>Muhammad Ilham</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>', 1, '2019-10-15 03:53:54', 999, 1, 'Pemerintahan Desa', 0, '', '', '', '', '', NULL, 0, 'pemerintahan-desa'),
(92, '1576551977_desain bagan.jpg', '<p><strong>Susunan Organisasi Pemerintah Desa Naluk</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Kepala Desa : Drs. Samsu Hidayat Ilyas<br />Sekretaris : Atep Dian Herdian<br />Kepala Urusan Umum : Avif Okta Yudha<br />Kepala Urusan Perencanaan : Dra. Yayah Hidayah<br />Kepala Urusan Keuangan : Ani Listianingsih, S.S<br />Kepala Seksi Pemerintahan : Wawan Gunawan<br />Kepala Seksi Kesra : Engkus Kusnadi<br />Kepala Seksi Pelayanan : Sunarya<br />Kepala Wilayah<br />Wilayah 1 Asep Saefulloh<br />Wilayah 2 Didih Suryadi<br />Wilayah 3 Sahma Nurhakim<br />Wilayah 4 Supriatna</p>', 1, '2019-10-15 03:39:56', 999, 1, 'Pemerintah Desa', 0, '1472006396', '1472006396', '1472006396', '', '', NULL, 0, 'pemerintah-desa'),
(93, '1577670521_w6.jpg', '<p style=\"text-align: center;\"><strong>VISI dan MISI</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>VISI</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>\"Nauk Masagi\"</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>(Bersih, Relegius, Sejahtera, Rapi, dan Indah)</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>\"Terwujudnya masyarakat Desa Senggigi yang Bersih, Relegius, Sejahtera, Rapi dan Indah melalui Akselerasi Pembangunan yang berbasis Keagamaan, Budaya Hukum dan Berwawasan Lingkungan dengan berorentasi pada peningkatan Kinerja Aparatur dan Pemberdayaan Masyarakat\"</strong></p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>MISI</strong></p>\r\n<p><strong>Misi dan Program Desa Senggigi</strong></p>\r\n<p>Dan untuk melaksanakan visi Desa Senggigi dilaksanakan misi dan program sebagai berikut:</p>\r\n<p>1. Pembangunan Jangka Panjang</p>\r\n<p>&nbsp; &nbsp; - Melanjutkan pembangunan desa yang belum terlaksana.</p>\r\n<p>&nbsp; &nbsp; - Meningkatkan kerjasama antara pemerintah desa dengan lembaga desa yang ada.</p>\r\n<p>&nbsp; &nbsp; - Meningkatkan kesejahtraan masyarakat desa dengan meningkatkan sarana dan prasarana ekonomi warga.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>2. Pembangunan Jangka Pendek &nbsp;</p>\r\n<p>&nbsp; &nbsp; - Mengembangkan dan Menjaga serta melestarikan ada istiadat desa terutama yang telah mengakar di desa senggigi.&nbsp;</p>\r\n<p>&nbsp; &nbsp; - Meningkatkan pelayanan dalam bidang pemerintahan kepada warga masyarakat&nbsp;</p>\r\n<p>&nbsp; &nbsp; - Meningkatkan sarana dan prasarana ekonomi warga desa dengan perbaikan prasarana dan sarana ekonomi.</p>\r\n<p>&nbsp; &nbsp; - Meningkatkan sarana dan prasarana pendidikan guna peningkatan sumber daya manusia Desa Senggigi.&nbsp;</p>', 1, '2019-10-15 03:48:28', 999, 1, 'Visi dan Misi Desa Naluk', 3, '1472006908', '1472006908', '1472006908', '', '', NULL, 0, 'visi-dan-misi-desa-naluk'),
(98, '1549419108_desa.jpg', '<p>Wilayah desa berisi tentang penjelasan dan deskripsi letak wilayah desa. contohnya sebagai berikut :<br />Batas-batas :<br />Utara&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Kelurahan a<br />Timur &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Desa b<br />Selatan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Desa c<br />Barat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Kelurahan d dan Desa e<br />Luas Wilayah Desa Penglatan&nbsp;&nbsp; : 186,193 Ha<br />Letak Dan Batas Desa x<br />Desa Penglatan terletak pada posisi 115. 7.20 LS 8. 7.10 BT, dengan ketinggian kurang lebih 250 M diatas permukaan laut.</p>\r\n<p>Peta Desa:</p>\r\n<p><iframe src=\"https://www.google.co.id/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=Logandu,+Karanggayam&amp;aq=0&amp;oq=logandu&amp;sll=-2.550221,118.015568&amp;sspn=52.267573,80.332031&amp;t=h&amp;ie=UTF8&amp;hq=&amp;hnear=Logandu,+Karanggayam,+Kebumen,+Central+Java&amp;z=14≪=-7.55854,109.634173&amp;output=embed\" width=\"600\" height=\"450\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe></p>', 2, '2019-10-15 07:28:14', 999, 1, 'Wilayah Desa', 0, '1472192894', '1472192894', '1472192894', '', '', NULL, 0, 'wilayah-desa'),
(99, '1575254881_nal.jpg', '<p style=\"text-align: justify;\" align=\"center\">Desa Naluk merupakan sebuah desa yang berada di wilayah Kecamatan Cimalaka Kabupaten Sumedang. Lokasinya berada di ujung barat laut wilayah Kecamatan Cimalaka dan berbatasan langsung dengan Kecamatan Tanjungkerta. Jarak dengan pusat Kecamatan Cimalaka sekitar 14 kilometer. Berdasarkan sejarahnya, Desa Naluk merupakan sebuah desa pemekaran. Pada awalnya, wilayah Desa Naluk merupakan bagian dari wilayah Desa Citimun. Pada tahun 1980, Desa Citimun dimekarkan menjadi dua wilayah desa yaitu Desa Citimun sebagai desa induk dan desa Naluk sebagai desa pemekaran. Pemekaran wilayah ini terkait dengan pemerataan pelaksanaan pembangunan dan memberikan pelayanan kepada masyarakat secara optimal di wilayah masing-masing. Ditambah dengan perkembangan dan pertumbuhan penduduk yang terus meningkat sehingga mencukupi untuk dilakukan pemekaran wilayah desa. Paska pemekaran wilayah desa, Desa Naluk memiliki cakupan wilayah di bagian barat bekas wilayah desa induk.</p>\r\n<p style=\"text-align: justify;\" align=\"center\">Berdasarkan data Kecamatan Cimalaka dalam Angka tahun 2014 yang dikeluarkan oleh Badan Pusat Statistik (BPS) Kabupaten Sumedang, pada tahun 2013 Desa Naluk memiliki status sebagai pedesaan dengan klasifikasi sebagai desa swakarsa lanjut. Secara topografis, wilayah Desa Naluk berada di kawasan berbentuk dataran dengan ketinggian wilayah dimana kantor desa berada pada 632 meter di atas permukaan laut. Secara geografis, wilayah Desa Naluk berada di kawasan yang dibatasi oleh wilayah-wilayah sebagai berikut: Desa Cipanas Kecamatan Tanjungkerta di sebelah utara dan baratnya, Desa Padasari dan Desa Citimun di sebelah timur, serta Desa Nyalindung dan Desa Trunamanggala di sebelah selatannya. Secara administratif, wilayah Desa Naluk terbagi ke dalam empat wilayah dusun yaitu Dusun 1 Naluk, Dusun 2 Naluk, Dusun 3 Cilimbangan dan Dusun 4 Sukabarang. Sementara jumlah Rukun Warga dan Rukun Tetangganya masing-masing sebanyak delapan RW dan 22 RT.</p>\r\n<p style=\"text-align: justify;\" align=\"center\">Untuk luas wilayahnya, sebagaimana disajikan oleh sumber data yang sama, pada tahun 2013 Desa Naluk memiliki wilayah dengan luas total sebesar 294,7 hektar. Dari luas wilayah tersebut, wilayah Desa Naluk terbagi ke dalam beberapa jenis tata guna lahan yaitu lahan pertanian, lahan pemukiman dan lahan lainnya. Lahan pertanian di Desa Naluk memiliki luasan wilayah sebesar 251,4 hektar. Lahan pertanian di Desa Naluk terbagi ke dalam dua jenis yaitu lahan pesawahan dan lahan pertanian bukan pesawahan. Untuk lahan pesawahannya memiliki luasan sebesar 105 hektar, dan lahan pertanian bukan pesawahannya sebesar 146,4 hektar. Sementara lahan pemukimannya mencakup wilayah seluas 41 hektar. Dan sisanya seluas 2,3 hektar dipergunakan sebagai lahan lainnya seperti lahan fasilitas umum.</p>\r\n<p style=\"text-align: justify;\" align=\"center\">Jika dilihat menggunakan Google Maps, wilayah Desa Naluk terletak di bagian barat laut ujung Kecamatan Cimalaka dan dilewati jalan perlintasan yang menghubungkan Kecamatan Cimalaka dengan Kecamatan Tanjungkerta. Lokasinya berada di sebelah barat kaki Gunung Tampomas dengan topografis bagian utara berupa dataran dan di bagian selatan merupakan kawasan perbukitan. Wilayahnya didominasi oleh lahan menghijau yang memungkinkan merupakan lahan perkebunan atau lahan kehutanan yang terletak di bagian tengah ke arah barat. Sementara bagian utara, timur dan selatan didominasi oleh kawasan pesawahan. Kawasan pemukiman terdapat di bagian timur laut dan bagian selatan.</p>\r\n<p style=\"text-align: justify;\" align=\"center\">Terkait mata pencaharian penduduk Desa Naluk, sebagian besar penduduknya bekerja di sektor pertanian. Sektor pertanian cukup mendominasi mata pencaharuan penduduk Desa Naluk jika dibandingkan dengan sektor lainnya seperti perdagangan, industri, jasa, transportasi dan konstruksi. Hal ini tidak bisa dipisahkan dengan kondisi wilayahnya yang mendukung sektor pertanian. Lahan pertaniannya yang subur, apalagi lahan pesawahannya sebagian sudah menggunakan sistem pengairan teknis. Tidak mengherankan jika lahan pesawahannya memiliki produktivitas yang sangat bagus.</p>\r\n<p style=\"text-align: justify;\" align=\"center\">Lahan pesawahan di Desa Naluk menghasilkan produk utama berupa padi. Selain dihasilkan lahan pesawahan, padi juga dihasilkan lahan ladangnya. Selain menghasilkan padi, dihasilkan juga berbagai jenis palawija seperti jagung, ubi kayu, ubi jalar dan kacang tanah. Lahan perkebunan di Desa Naluk menghasilkan berbagai jenis buah-buahan seperti alpukat, belimbing, durian, jambu biji, dan mangga. Sektor industri yang digeluti masyarakat Desa Naluk tergolong industri kecil skala rumah tangga. Jenis industrinya terkait dalam pengolahan makanan dan pembuatan batu bata serta genteng.</p>', 1, '2019-10-15 08:38:09', 999, 1, 'Sejarah Desa', 3, '1472229325490125_20121123041539.jpg', '1472197089', '1472197089', '', '', NULL, 1, 'sejarah-desa'),
