enalan-kepala-desa'),
(106, '1576661292_BKKBN-Terus-Optimalkan-Kampung-KB-.jpg', '<p><strong>BANDUNG&nbsp;</strong>&ndash; Keberadaan kampung KB di Jawa Barat kedepan rencananya akan terus ditingkatkan. Sehingga, program-program KB dapat langsung diterima dan dirasakan oelh masyarakat.</p>\r\n<p>Kepala BKKBN Perwakilan Jawa Barat, Sukaryo Teguh Santoso mengatakan, Kampung KB di Jabar merupakan miniatur program kependudukan yang berisi program pembangun dimulai dari satuan kelompok terkecil yaitu, keluarga.</p>\r\n<p>Kampung KB memiliki hubungan erat dengan bidang lainnya dalam rangka meningkatkan kualitas hidup manusia.<br />Terutamanya bagi masyarakat dengan jumlah penduduk padat, daerah terpencil, penduduk miskin, dan pesisir.</p>\r\n<p>Dia menyebutkan, di Jabar kampung KB berjumlah 1.326 yang tersebar di kabupaten/kota di Jabar. Bahkan, untuk 2018 keberadaan kampung KB akan terus bertambah.</p>\r\n<p>&rsquo;&rsquo; Dari jumlah itu sebanyak 625 Kampung KB bersumber dari APBN dan 700 dari APBD kabupaten dan kota. Maka diharapkan jumlah Kampung KB akan terus bertambah dengan banyaknya dukungan terutama dari pemerintah daerah,&rsquo;&rsquo;jelas Teguh ketika ditemui kemarin. (20/8)</p>\r\n<p>Dia menuturkan, berdasarkan target Kampung KB di Jabar sebetulnya sudah sangat baik. Sehingga, perlu dijalankan programnya secara berkesinambungan. Terlebih, Kampung KB didirikan bukan mengurusi soal aseptor KB saja tetapi mengurusi juga soal sosial, ekonomi,lingkungan dan lainnya.</p>\r\n<p>&nbsp;</p>\r\n<p>Sementara itu, Kepala Dinas Pengendalian Penduduk dan Keluarga Berencana Kabupaten Sumedang Nasam mengatakan,<br />di Desa Naluk II Kecamatan Cimalaka, merupakan salah satu desa yang dinilai cukup berhasil dalam melaksanakan program Kampung KB-nya.</p>\r\n<p>Hal ini terlihat dari beberapa indikator keberhasilan di desa itu di antaranya, angka kelahiran menurun, peningkatan kesejahteraan, dan partisipasi warganya terhadap KB metode jangka panjang menunjukkan kenaikan.</p>\r\n<p>Dia mengatakan, di Kabupaten Sumedang saat ini 27 Kampung KB. Bahkan, setelah ada Kampung KB di desa tersebut ada perubahan dengan ditunjukan angka partisipasi KB meningkat yaitu dari awal pencanangan hanya sekitar 72 persen menjadi 82 persen.</p>\r\n<p>&ldquo;Ini sangat berhubungan juga dengan menurunnya angka kelahiran di Kabupaten Sumedang, terutama yang cukup berhasil adalah di Desa Naluk II,&rdquo; tuturnya.</p>\r\n<p>Ditempat berbeda Kepala Dusun Naluk II Kecamatan Cimalaka Kabupaten Sumedang, Haji Sutia Sunartiana mengakui, sebelum ada program Kampung KB sebenarnya Desa Naluk II sudah banyak program pemberdayaan di berbagai bidang.</p>\r\n<p>Namun setelah adanya Kampung KB, kegiatan dan program-program kembali mulai banyak peminatnya. Terlebih, dengan dukungan anggaran<br />Keberhasilan Kampung KB sangat terasa adalah angka kelahiran di Dusun Naluk II yang menurun. Sebab, jumlah penduduk kurang lebih 500 jiwa dan terbanyak adalah laki-laki usia produktif.</p>\r\n<p>&ldquo;Karena jumlah penduduknya cukup banyak, maka kami gencar sosialisasikan KB dan meski ada penolakan akhirnya mampu mengubah pandangan salah soal KB dan warga mulai aktif berpartisipasi dalam KB,&rdquo; tutup Sutia. (mg2/yan)</p>\r\n<p>sumber:&nbsp;<a href=\"http://jabarekspres.com/\">http://jabarekspres.com/</a>&nbsp;</p>', 1, '2019-12-18 09:26:20', 20, 1, 'BKKBN Terus Optimalkan Kampung KB', 0, NULL, NULL, NULL, NULL, '', NULL, 1, 'bkkbn-terus-optimalkan-kampung-kb'),
(107, '1577671296_byLord7rRvIfMuolkJbVW4Dqpb6IKdSeAMyDyIO4.jpeg', '<p>SUMEDANG, (PR).- Pemerintah Kabupaten&nbsp;Sumedang akan membentuk 30 desa digital yang tersebar di enam kecamatan. Program desa digital itu, sengaja dilakukan guna meningkatkan indeks sistem pemerintahan berbasis elektronik (SPBE). Pasalnya, indeks SPBE di Kabupaten Sumedang dinilai masih relatif rendah.</p>\r\n<p>&ldquo;Kondisi tersebut, salah satunya ditandai desa yang melek internet di Kabupaten Sumedang hanya di bawah 10%. Kami tak memungkiri hal itu. Justru melalui program desa digital inilah, kami berupaya untuk meningkatkan angka indeks SPBE. Dari angka Indeks SPBE Kabupaten Sumedang sekarang&nbsp; ini 2,5. Tahun ini ditargetkan naik menjadi 3,&rdquo; kata Sekretaris Daerah (Sekda) Kabupaten Sumedang, Herman Suryatman ketika dihubungi di Sumedang, Minggu 14 April 2019.</p>\r\n<p>Ia menyebutkan, 30 desa yang akan dijadikan desa digital, di antaranya Desa Hariang, Karangbungur dan Mekarmukti di Kecamatan Buahdua. Selain itu, Desa Ungkal dan Padaasih di Kecamatan Conggeang. Desa Tanjungmulya, Boros dan Awilega di Kecamatan Tanjungkerta; Desa Sukatani, Jingkang, Kamal dan Tanjungmedar di Kecamatan Tanjungmedar.</p>\r\n<p>Desa digital itu, nantinya akan memiliki sistem informasi desa dan situs&nbsp;<em>web</em>&nbsp;(<em>web</em><em>&nbsp;site</em>).</p>\r\n<p>&ldquo;Kami sudah menyiapkan aplikasinya. Bahkan saya sudah bekerja sama dengan Telkom untuk memasang jaringan wifi di 30 desa digital. Mudah-mudahan lancar, Mei nanti semua desa digital ini sudah&nbsp;<em>online</em>. Untuk perangkat lainnya, secara bertahap akan dilengkapi.</p>\r\n<p>&ldquo;Umumnya sekarang kan, setiap desa sudah punya komputer sendiri. Jadi, memanfaatkan sarana yang ada dulu,&rdquo; tutur Herman.</p>\r\n<p>Dalam sistem informasi desa, kata dia, semua perangkat desa termasuk para praja IPDN yang kini tengah praktek lapangan (PL) II, akan menghimpun, mengidentifikasi, sekaligus mengolah berbagai data tentang desanya masing-masing. Selanjutnya, data tersebut&nbsp; akan dimasukkan ke dalam situs web desa.&nbsp; &ldquo;Data-datanya, dari mulai data geografis desa,demografi, kondisi sosial, budaya hingga kondisi perekonomian desa. Intinya, semua data terkait desa bersangkutan harus dimasukkan ke dalam situs&nbsp;<em>web</em>,&rdquo; tuturnya.</p>\r\n<p>Lebih jauh Herman&nbsp; menjelaskan, situs web tersebut nantinya menjadi kumpulan&nbsp; data-data penting tentang desa. Kumpulan datanya, akan dijadikan dasar dalam merumuskan kebijakan pemerintahan desa. Hal itu termasuk upaya mengentaskan kemiskinan di masing-masing desa. Pemkab Sumedang&nbsp; akan terus memantau setiap perkembangannya.</p>\r\n<p>&ldquo;Terkait data kemiskinan, di Badan Perencanaan Pembangunan, Penelitian dan Pengembangan (Bappppeda) sudah ada data-data kemiskinan setiap desa. Nah data kemiskinan ini,&nbsp; bisa dimasukan ke dalam sistem informasi desa dan juga situs&nbsp;<em>web</em>-nya. Dalam pelaksanaannya, pemda akan membantu mengolah datanya,&rdquo; ucapnya.</p>\r\n<p>Ia menambahkan, guna menunjang desa digital, Pemkab Sumedang pun sudah bekerja sama dengan Telkom dalam meningkatkan kualitas jaringan internet di lingkungan Sekretariat Daerah (Setda) Kabupaten Sumedang. Upaya tersebut, agar jaringan internet di lingkungan Setda bisa mengakses</p>\r\n<p>30 desa digital dengan cepat. &ldquo;Sebelumnya, di sekitar Setda sudah dipasang&nbsp;<em>fiber optic</em>. Jadi, kami bisa mengakses dengan cepat berbagai informasi dan data desa digital,&rdquo; kata Herman. ***</p>', 1, '2019-12-30 02:01:38', 20, 1, 'Sumedang Membentuk 30 Desa Digital', 0, NULL, NULL, NULL, NULL, '', NULL, 1, 'sumedang-membentuk-30-desa-digital'),
(108, '1577671472_xzs.jpg', '<p><strong>TRIBUNJABAR.ID, SUMEDANG -</strong>&nbsp;Teknologi membuka peluang baru bagi warga untuk berkembang. Media sosial, misalnya, dapat menjadi potensi ekonomi melalui produksi konten kreatif. Jawa Barat, dengan visi untuk menjadi Provinsi Digital yang inklusif, meluncurkan program &ldquo;Desa Digital: Multimedia&rdquo; pada 2 Desember 2019 di Jatinangor, Kabupaten Sumedang.</p>\r\n<p>Bersama mitra lembaga kursus desain grafis dan multimedia, Hellomotion, peluncuran program&nbsp;<a title=\"Desa&nbsp;Digital\" href=\"https://jabar.tribunnews.com/tag/desa-digital\">Desa&nbsp;Digital</a>&nbsp;tematik ini diselenggarakan Pemerintah Provinsi Jawa Barat dalam bentuk seminar dan workshop berjudul &ldquo;Potensi Ekonomi di Dunia Visual: Konten Visual Kreatif untuk #JabarJuara Lahir Batin&rdquo; yang diisi oleh pakar dan praktisi konten visual kreatif seperti Wahyu Aditya dari Hellomotion, Abdul Bar dari Kampung Logo, Yosi Project Pop, dan Youtuber asal&nbsp;<a title=\"Sumedang\" href=\"https://jabar.tribunnews.com/tag/sumedang\">Sumedang</a>, Krisna Supriyatna.</p>\r\n<p>Peserta acara ini adalah 240 perwakilan terpilih dari berbagai desa di Jawa Barat yang merupakan pengelola akun media sosial desa, komunitas kreatif desa, dan anggota karang taruna desa. Sebagian dari peserta juga menerima pelatihan satu hari mengenai prinsip desain yang sesuai dengan gaya visual komersial dan bagaimana mendapatkan penghasilan dari karya desain grafis.</p>\r\n<p>Selama sesi, peserta juga mempraktikkan secara langsung ilmu yang diberikan melalui telepon genggam. Pelatihan ini berupaya untuk mengubah mindset masyarakat desa untuk fokus bukan kepada keterbatasan alat, melainkan kepada ide kreatif dan promosi potensi desa apa yang bisa mereka lakukan dengan alat yang mereka miliki.</p>\r\n<p>Program&nbsp;<a title=\"Desa&nbsp;Digital\" href=\"https://jabar.tribunnews.com/tag/desa-digital\">Desa&nbsp;Digital</a>&nbsp;ini diselenggarakan Pemprov Jabar untuk memastikan manfaat kemajuan teknologi juga dinikmati oleh warga desa. Peningkatan kapasitas berupa pelatihan literasi digital diperlukan untuk memastikan bahwa masyarakat di daerah rural juga dapat berkembang menggunakan inovasi teknologi yang sudah ada serta siap untuk menghadapi persaingan di industri 4.0 dan tidak mudah terpapar konten negatif internet.</p>\r\n<p>Selain &ldquo;Multimedia&rdquo;, program&nbsp;<a title=\"Desa&nbsp;Digital\" href=\"https://jabar.tribunnews.com/tag/desa-digital\">Desa&nbsp;Digital</a>&nbsp;juga mengadopsi berbagai tema yang sesuai dengan potensi atau kebutuhan desa-desa Jawa Barat, seperti agrikultur, peternakan, perikanan, dan kesehatan.<br /><br />Artikel ini telah tayang di&nbsp;<a href=\"https:\">tribunjabar.id</a>&nbsp;dengan judul Jawa Barat luncurkan &ldquo;Desa Digital: Multimedia&rdquo; di Kabupaten Sumedang,&nbsp;<a href=\"https://jabar.tribunnews.com/2019/12/16/jawa-barat-luncurkan-desa-digital-multimedia-di-kabupaten-sumedang\">https://jabar.tribunnews.com/2019/12/16/jawa-barat-luncurkan-desa-digital-multimedia-di-kabupaten-sumedang</a>.<br /><br />Editor: bisnistribunjabar</p>', 1, '2019-12-30 02:04:33', 20, 1, 'Jawa Barat luncurkan “Desa Digital: Multimedia” di Kabupaten Sumedang', 0, NULL, NULL, NULL, NULL, '', NULL, 1, 'jawa-barat-luncurkan-desa-digital-multimedia-di-kabupaten-sumedang');
